import React from "react";
import './App.css';
import classNames from "classnames"
import Header from "./Header";
import Footer from "./Footer";
import Navbar from "./Navbar";

const name = "Chris";
// const year = customElements.getFullYear();

const App = () => {
  return (
    <div className="App">
       <Header/>
        <Navbar/>
        <Footer/>
        <p>Created by {name}</p>
        <p>Copyright {year}</p>
    </div>
  );
}

export default App;
